import React, { useState } from 'react';
import img1 from './Assert/volunteer-1326758-1080x675.png';
import img2 from './Assert/400dpiLogo.png';
import { BrowserRouter, Route, Routes, useNavigate } from 'react-router-dom';
import HappyKids from './pages/HappyKids'; // Import the HappyKids page
import FosterKitten from './pages/FosterKitten'; // Import the FosterKitten page
import SaveTheWorld from './pages/SaveTheWorld'; // Import the SaveTheWorld page

function App() {
  const [events] = useState([
    { id: 1, title: 'Foster for Kitten or Cat', date: '12-02-2025' },
    { id: 2, title: 'Happy Kids', date: '01-03-2025' },
    { id: 3, title: 'Save the world', date: '22-04-2025' },
  ]);

  return (
    <BrowserRouter>
      <div className="App">
        {/* Header Section */}
        <header className="header">
          <div className="home">
           <p>
              <img src={img2} alt="" />
              SHARE-CARE
            </p>
          </div>
          <div className="contact-info">
            <button>Contact Us</button>
          </div>
          <div className="login">
            <button>Login</button>
          </div>
          <div className="signin">
            <button>Sign Up</button>
          </div>
          <div className="donation-bar">
            <button>Donate Now!</button>
          </div>
        </header>

        {/* Main Content */}
        <main className="main-content">
          <div className="image-gallery">
            <img src={img1} alt="" />
          </div>
          <section className="events">
            <h2>Upcoming Events</h2>
            <ul>
              {events.map((event) => (
                <EventItem key={event.id} event={event} />
              ))}
            </ul>
          </section>

          {/* Define Routes for each Event */}
          <Routes>
            <Route path="/event/1" element={<FosterKitten />} />
            <Route path="/event/2" element={<HappyKids />} />
            <Route path="/event/3" element={<SaveTheWorld />} />
          </Routes>
        </main>
      </div>
    </BrowserRouter>
  );
}

// EventItem Component to handle click and navigate
const EventItem = ({ event }) => {
  const navigate = useNavigate();

  const handleClick = () => {
    // Navigate programmatically to the event detail page
    navigate(`/event/${event.id}`);
  };

  return (
    <li>
      <h3 onClick={handleClick} style={{ cursor: 'pointer', color: 'blue' }}>
        {event.title}
      </h3>
      <p>Date: {event.date}</p>
    </li>
  );
};

export default App;
